import React from 'react'
import "./Note.css"

function Note(props) {

    function handleClick() {
        props.onDelete(props.id);
    }

    return (
        <div className="note">
            <h1>{props.title}</h1>
            <p>{props.start} - {props.end}</p>
            <div className="actions">
                <span onClick={handleClick}><i class="fas fa-pencil-alt"></i></span>
                <span onClick={handleClick}><i class="fas fa-trash-alt"></i></span>
            </div>
            <hr ckassName="hr" />
        </div>
    )
}

export default Note
